import React from 'react';
import {ReactComponent as Logo} from "./sun.svg"

function App() {
  return (
    <div>
      <nav style="display:block">
        <ul>
          <Logo />
          <li> Home </li>
          <li> 2nd page </li>
          <li> 3rd page </li>
          <li> 4th page </li>
          <li> 5th page </li>
          <li> 6th page </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
